import React, {Component} from "react";
import Card from "../Card/Card";
import "./estilos.css";


class Baralho extends Component{

    constructor(props){
        super(props);
        
    }

   
           
    render(){
        
        if(!this.props.visivel){
            return null
        }
        else{
            return (
            
                <ul>
                
                    {this.props.cartas.map((cartas,index)=>{
                        return(
                            <li key={'bar'+index}>
                           
                                <Card 
                                  bandeira={cartas.bandeira}
                                  id={cartas.id}
                                  país={cartas.país} idh={cartas.idh} exp={cartas.exp}/>
                            </li>
                        )
                    })}
                    
                </ul>
                   
               
              
               ); 
        }
        
    }
   
}

export default Baralho;
